import React from 'react';
import UserSettingsProvider from './components/UserSettingsProvider';
import SettingsForm from './components/SettingsForm';
import DisplaySettings from './components/DisplaySettings';
import withTimeTracker from './components/withTimeTracker';
import Tooltip from './components/Tooltip';

const TimeTrackedDisplay = withTimeTracker(DisplaySettings);
const TimeTrackedComponentA = withTimeTracker(ComponentA);
const TimeTrackedComponentB = withTimeTracker(ComponentB);

const App = () => {
  return (
    <UserSettingsProvider>
      <div>
        <SettingsForm />

        {/* Use TimeTrackedDisplay instead of DisplaySettings */}
        <TimeTrackedDisplay />

        <Tooltip position="top" text="Top Tooltip">
          <button>Hover me</button>
        </Tooltip>

        <Tooltip position="right" text="Right Tooltip">
          <button>Hover me</button>
        </Tooltip>

        <Tooltip position="bottom" text="Bottom Tooltip">
          <button>Hover me</button>
        </Tooltip>

        <Tooltip position="left" text="Left Tooltip">
          <button>Hover me</button>
        </Tooltip>
      </div>
    </UserSettingsProvider>
  );
};

export default App;
